// LoginButton.style.jsx
import styled from "styled-components";

const LoginButtonStyle = styled.button`
  background-color: white;
  margin-left: auto;
  margin-right: 10px;
  font-size: 0.8rem;
  border: 0.2vw solid #2a2a3a;
  border-radius: 1.5vw;
  background: #white;
  color: #484a64;
  outline: none;
  padding: 0.2vw 1vw 0.2vw 1vw;
  
`;

export default LoginButtonStyle;
